import React, {useState} from 'react'

function App() {

  const[count, setCount] = useSate(0);

  const handleIncrease = ()=>{}

  return (
    <div>
      count : <h1>{count}</h1>
      <hr/>

      <div>
      <button type="button" onclick={handleIncrease}>Increase</button>
      </div>
    </div>
  )
 }

export default App
